  `sku_specs` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '供应商尺码',
  PRIMARY KEY (`id`),
  UNIQUE KEY `spu` (`spu`),
  KEY `status` (`status`)
) ENGINE=InnoDB AUTO_INCREMENT=2324936 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

